     increment() {
       this.setState(this.state.Counter+1)    
    }
    dicrement(){
        this.setState(this.state.Counter-1)
    }
    render() { 
        return (
            <div>
            <h2>Hllow Gusy</h2>
            <h3> </h3>Counter:state
              <button type='button' onClick="">+
             </button>     
              <button type='button' onClick="">-
             </button>     
            </div>
         );
    }
}
 
export default FrontEnd;
